

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertFalse;
import static org.junit.Assert.assertTrue;

import java.io.File;
import java.util.List;

import mensa.api.ApiImagePoster;
import mensa.api.hibernate.HibernateUtil;
import mensa.api.hibernate.domain.ImageProposal;
import mensa.api.hibernate.domain.Meal;
import mensa.api.hibernate.domain.MealData;
import mensa.api.hibernate.domain.RatingCollection;

import org.hibernate.Session;
import org.hibernate.SessionFactory;
import org.junit.After;
import org.junit.Before;
import org.junit.Test;


public class ApiImagePosterBasicTest {

    private SessionFactory sessionFactory;
    private Session session = null;
	private int mealid = 0;
	private String mealName;
	private String userid;
	private String image;
	private File file = null;
    
	@Before
	public void before() {
		mealName = "fduio[pl";
		userid = "asdfg53";
		image = "";
		sessionFactory = HibernateUtil.getSessionFactory();
		session = sessionFactory.openSession();		
	}
	
	@Test
	public void basicTest() {
		MealData testData = new MealData();
		testData.setRatings(new RatingCollection());
		
		Meal testMeal = new Meal();
		testMeal.setName(mealName);
		testMeal.setData(testData);
		
		session.beginTransaction();
		session.save(testMeal);
		session.getTransaction().commit();
		
		mealid = testMeal.getMealid();
		
		new ApiImagePoster().doImage(userid, image, mealid);
		
		List<ImageProposal> proposals = session.createCriteria(ImageProposal.class).list();
		
		assertFalse(proposals.isEmpty());
		assertEquals(proposals.get(0).getUserid(), userid);
		assertEquals(proposals.get(0).getMealid(), mealid);
		
		file = new File(proposals.get(0).getPath());
		assertTrue(file.exists());
	}
	
    @After
    public void after() {
    	if (file != null) {
    		file.delete();
    	}
    	if (mealid != 0) {
			session.beginTransaction();
			session.delete(session.get(Meal.class, mealid));
			session.getTransaction().commit();
		}
    	session.close();
    }
}
